deck_description:
The deck in action &gt; <a>https://www.youtube.com/watch?v=_Qr7GrPcn4I</a>

&nbsp;

The Synergy is obvious! Dangers discard fableds, fableds trigger and drop on a field. Oh and some Fabled monsters are tuners Hi Needlefiber. This is futuristic build of Fableds because they ll be a serious perhaps even a rouge deck once fiber drops. Sure some Dangers might get semi-limited or limited by that time but thats ok.

Do you like dangers? Do you like synchros? This is a perfect deck for you

&nbsp;

Hey, want everyone you play against to hate you?  Use the sure to be at least limited New Field Spell to block all monster effects for your opponent, <a data-name="Metaverse">Metaverse</a> helps search it along with your <a data-name="Terraforming">Terraforming</a>.  Ojama Trio makes sure they have SOMETHING on field, plenty of burn cards that do even better when your opponent has tons of stuff set up, and an extra deck fully useless so you can use Pot of Extravagance without worry to get to your Spell-Mining Cave/Mystic Mine faster!

&nbsp;

and yes this IS the one from that one video but nobody uploaded it and i wanted to share the degeneracy before it got banned super hard

If you draw into it, summon your reflector and get your stardust on board and Assault mode set, then go about your normal Orcust plays. Reflector is a 1 card combo, so it doesn't really brick you. If it gets negated, you can still go into Savage dragon later in the combo (It's dark so Orcusts don't stop it from coming out). It makes for amazing Ash Bait.

&nbsp;

Side deck hasn't been tested very well, so add what you want.

&nbsp;

Let me know what you think :)

First things first, do NOT worry about the 60 cards.  With all the draw power and searching you can do with the Impcantations, you practically NEED 60 cards.  All of these cards synergize well with each other and one impcantation leads to a great board.  Amorphacator Pain completely gets rid of their Main Phase 1 and the Shinobaron's return Monsters and Spells/Traps to the deck and hand, depending on each one.  An interesting spirit card I found was Amaterasu which basically banishes your opponent's entire field.  Extra deck is really flexible as long as you have N'Tss and Arc Light in there.

Try this deck out if you're looking for an out-of-the-box Control deck.

&nbsp;

